import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  height: 450px;
  background-color: #eef3c0;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

const AvatarContainer = styled.div``;

const AvatarContainerColumn = styled.div``;

const AvatarImgContainer = styled.div`
  width: 720px;
  height: 720px;
  background-color: white;
`;

const AvatarImg = styled.img``;

const AvatarDescription = styled.span``;

const AvatarInfo = styled.span``;

const DescriptionContentBlock = () => (
  <Container>
    <AvatarContainer>
      <AvatarContainerColumn>
        <AvatarImgContainer>
          <AvatarImg></AvatarImg>
        </AvatarImgContainer>
      </AvatarContainerColumn>
      <AvatarContainerColumn></AvatarContainerColumn>

      <AvatarDescription></AvatarDescription>
      <AvatarInfo></AvatarInfo>
    </AvatarContainer>
  </Container>
);
export default DescriptionContentBlock;
